import React, {Component} from "react";

const startAnimation = function() {
	return(
		<div>
			Hello
		</div>
	);
};

class Background extends Component{


	render(){
		return(
			<span className="hello">
				{startAnimation()}
			</span>
		);
	}
}

export default Background;
